import React from 'react';
import BlogPost from './BlogPost';

const BlogList = ({post}) => {
    return (
        <div>
            {post.map((post, index)=> (
                <BlogPost key={index} 
                        increment={index + 1} 
                        title={post.title} 
                        content={post.content} 
                        imageUrl={post.imageUrl}/>
            ))}
        </div>
    );
}

export default BlogList;
